    await page.waitForSelector('input[type="radio"][value="1"]'); // Adjust here based on the actual gender value
    await page.check('input[type="radio"][value="1"]');

    // Select birth date
    await page.selectOption('select:nth-of-type(1)', '1'); // January
    await page.selectOption('select:nth-of-type(2)', '5'); // 5th
